import React from 'react';
import styles from '../Meals/Meals.module.css'
import FoodItem from '../FoodItem/FoodItem'



const Meals = props => {
    return (
        <div className={styles.meals}>
            {props.meal_data.map(item => {
            <FoodItem meal={item}></FoodItem>
            })}
        </div>
    )
}

export default Meals;
